<#
.Synopsis
   Wrapper for Certify Version 1.1.0
.EXAMPLE
   Import-Module .\Invoke-Certify.ps1
   OR
   . .\Invoke-Certify.ps1
   Invoke-Certify -command 'find /vulnerable'
.NOTES
    For more examples see Rubeus documentation https://github.com/GhostPack/Certify
    This version of Invoke-Hagrid uses the build of Rubeus from OffensivePipeline, so it was ran through ConfuserEx, Donut etc. 
    https://github.com/Aetsu/OffensivePipeline
#>
$CertifyAssembly = [System.Reflection.Assembly]::Load([Convert]::FromBase64String("
"))


function Invoke-Certify
{
    Param
    (
         [Parameter(Mandatory=$false)]
         [string]$Command = "-h"
    )

    [Certify.Program]::Main("$Command".Split())
}

Write-Host "You can now use Invoke-Certify -Command 'CAMMMAND_HERE'"
